import espresso from "../assets/espresso.jpg";
import frappe from "../assets/greek-frappe.jpg";
import beans from "../assets/beans.jpg";
import latte from "../assets/latte.jpg";

const PRODUCTS = [
  { id: 1, name: "Espresso", description: "Strong and bold espresso", price: 2.5, image: espresso },
  { id: 2, name: "Frappe", description: "Smooth and chilled coffee", price: 3.5, image: frappe },
  { id: 3, name: "Latte", description: "Creamy milk coffee", price: 3.0, image: latte },
  { id: 4, name: "Coffee Beans", description: "Premium roasted beans", price: 10.0, image: beans },
];

export default PRODUCTS;
